// src/App.js - CORRECTED
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';

import Header from './components/header';
import Navbar from './components/navbar';
import Footer from './components/footer';

// Your page components (imported, but not directly rendered here)
import Home from './components/home';
import Login from './pages/login';
import Companies from './pages/companies';
import Register from './pages/register';

function App() {
  return (
    <BrowserRouter>
      {/* Components that should appear on ALL pages (e.g., Navbar, Header, Footer) */}
      <Navbar />
      <Header />

      {/* THIS IS THE ONLY PLACE YOUR PAGE COMPONENTS SHOULD BE RENDERED */}
      <Routes>
        <Route path="/home" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/companies" element={<Companies />} />
        <Route path="/register" element={<Register />} />
        {/* Optional: Add a catch-all route for 404 Not Found pages or redirects */}
        <Route path="*" element={<h2>404 - Page Not Found</h2>} />
      </Routes>

      {/* Components that should appear on ALL pages */}
      <Footer />
    </BrowserRouter>
  );
}

export default App;
